    transmission VARCHAR(50),
    engine_power VARCHAR(50),
    engine_displacement INT,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    CHECK (alt_model_id IS NOT NULL OR model_id IS NOT NULL)
);

